#define _mm_loadh_epi64(a, ptr)     _mm_castps_si128(_mm_loadh_pi(_mm_castsi128_ps(a), (__m64 *)(ptr)))
#define _mm_storeh_epi64(ptr, a)    _mm_storeh_pi((__m64 *)(ptr), _mm_castsi128_ps(a))

//histograms declaration
extern const BYTE histoYrg [];
extern const BYTE histoYrg2[];
extern const BYTE histoYrg3[];

//builds skin probability map

//Builds skin probability map (dynamic fast)
void BuildSkinMap_dyn_C(BYTE* skinProb, BYTE* src, Dim* dim, uint bg, uint yTh, int hist_ind, int mode)
{
    FS_UNREFERENCED_PARAMETER(mode);
    const BYTE *hysto;
    BYTE *srcy, *srcx;
    int len;

    //set skin probability histogram
    switch (hist_ind) {
    case 0: hysto = histoYrg;  break;
    case 1: hysto = histoYrg2; break;
    case 2: hysto = histoYrg3; break;
    }

    //compute skin probability map
    { srcy = src + dim->ubOff; srcx = src + dim->vbOff; len = dim->ubOff; }

    assert((yTh - bg) >= 2);
    int frac = (65536 + (yTh-bg-1)) / (yTh-bg); // recip in Q16, rounded up

    for (int k = 0; k < len; k++) {
        int h = hysto[(srcy[k] << 8) + srcx[k]];
        int s = src[k];

        s = s - bg;
        s = MAX(s, 0);
        s = s * h;
        s = (s * frac) >> 16;
        s = MIN(s, h);

        skinProb[k] = s;
    }
}

//Builds skin probability map (dynamic fast)
void BuildSkinMap_dyn_slice_C(BYTE* skinProb, BYTE* src, Dim *dim, uint bg, uint yTh, int hist_ind, int mode, uint slice_offset, int slice_nlines)
{
    FS_UNREFERENCED_PARAMETER(mode);
    const BYTE *hysto;
    BYTE *srcy, *srcx;
    int pitch, w;

    //set skin probability histogram
    switch (hist_ind) {
    case 0: hysto = histoYrg;  break;
    case 1: hysto = histoYrg2; break;
    case 2: hysto = histoYrg3; break;
    }

    //compute skin probability map
    { srcy = src + dim->ubOff; srcx = src + dim->vbOff; }

    srcy+= slice_offset;
    srcx+= slice_offset;
    pitch = dim->wb;
    w = dim->wb;

    assert((yTh - bg) >= 2);
    int frac = (65536 + (yTh-bg-1)) / (yTh-bg); // recip in Q16, rounded up

    for (int n=0; n<slice_nlines; n++) {
        int ind = n*pitch;

        for (int k=0; k<w; k++) {
            int h = hysto[(srcy[ind+k] << 8) + srcx[ind+k]];
            int s = src[slice_offset+ind+k];

            s = s - bg;
            s = MAX(s, 0);
            s = s * h;
            s = (s * frac) >> 16;
            s = MIN(s, h);

            skinProb[ind+k] = s;
        }
    }
}

//Gather 16 bytes from lookup table, using 16-bit index
static inline __m128i gather16_SSE4(const BYTE *table, __m128i index0, __m128i index1)
{
    __m128i t = _mm_setr_epi8(
        table[(WORD)_mm_extract_epi16(index0, 0)],
        table[(WORD)_mm_extract_epi16(index0, 1)],
        table[(WORD)_mm_extract_epi16(index0, 2)],
        table[(WORD)_mm_extract_epi16(index0, 3)],
        table[(WORD)_mm_extract_epi16(index0, 4)],
        table[(WORD)_mm_extract_epi16(index0, 5)],
        table[(WORD)_mm_extract_epi16(index0, 6)],
        table[(WORD)_mm_extract_epi16(index0, 7)],

        table[(WORD)_mm_extract_epi16(index1, 0)],
        table[(WORD)_mm_extract_epi16(index1, 1)],
        table[(WORD)_mm_extract_epi16(index1, 2)],
        table[(WORD)_mm_extract_epi16(index1, 3)],
        table[(WORD)_mm_extract_epi16(index1, 4)],
        table[(WORD)_mm_extract_epi16(index1, 5)],
        table[(WORD)_mm_extract_epi16(index1, 6)],
        table[(WORD)_mm_extract_epi16(index1, 7)]
    );
    return t;   // 16 x 8-bit
}

//Gather 16 bytes from lookup table, using 32-bit index
static inline __m256i gather16_AVX2(const BYTE *table, __m256i index0, __m256i index1)
{
    __m256i t0 = _mm256_i32gather_epi32((const int *)table, index0, 1);
    __m256i t1 = _mm256_i32gather_epi32((const int *)table, index1, 1);

    t0 = _mm256_and_si256(t0, _mm256_set1_epi32(0x000000ff));   // clear extraneous data
    t1 = _mm256_and_si256(t1, _mm256_set1_epi32(0x000000ff));

    t0 = _mm256_packs_epi32(t0, t1);
    t0 = _mm256_permute4x64_epi64(t0, _MM_SHUFFLE(3,1,2,0));

    return t0;  // 16 x 16-bit
}

//Builds skin probability map (dynamic fast)
void BuildSkinMap_dyn_SSE4(BYTE* skinProb, BYTE* src, Dim* dim, uint bg, uint yTh, int hist_ind, int mode)
{
    FS_UNREFERENCED_PARAMETER(mode);
    const BYTE *hysto;
    BYTE *srcy, *srcx;
    int len;

    //set skin probability histogram
    switch (hist_ind) {
    case 0: hysto = histoYrg;  break;
    case 1: hysto = histoYrg2; break;
    case 2: hysto = histoYrg3; break;
    }

    //compute skin probability map
    // if (mode==0) { srcy = src + dim->uOff;  srcx = src + dim->vOff;  len = dim->uOff;  }
    // else if (mode==1) 
    { srcy = src + dim->ubOff; srcx = src + dim->vbOff; len = dim->ubOff; }

    assert((yTh-bg) >= 2);
    int frac = (65536 + (yTh-bg-1)) / (yTh-bg); // recip in Q16, rounded up

    int k;
    for (k = 0; k < len - 15; k += 16) {
        __m128i y = _mm_loadu_si128((__m128i *)&srcy[k]);   // 16
        __m128i x = _mm_loadu_si128((__m128i *)&srcx[k]);
        __m128i s = _mm_loadu_si128((__m128i *)&src[k]);

        __m128i i0 = _mm_unpacklo_epi8(x, y);           // i = (y<<8) + x
        __m128i i1 = _mm_unpackhi_epi8(x, y);

        __m128i h = gather16_SSE4(hysto, i0, i1);       // h = hysto[i]

        __m128i s0 = _mm_unpacklo_epi8(s, _mm_setzero_si128());
        __m128i s1 = _mm_unpackhi_epi8(s, _mm_setzero_si128());
        __m128i h0 = _mm_unpacklo_epi8(h, _mm_setzero_si128());
        __m128i h1 = _mm_unpackhi_epi8(h, _mm_setzero_si128());

        s0 = _mm_subs_epu16(s0, _mm_set1_epi16(bg));    // MAX(s - bg, 0)
        s0 = _mm_mullo_epi16(s0, h0);
        s0 = _mm_mulhi_epu16(s0, _mm_set1_epi16(frac));
        s0 = _mm_min_epu16(s0, h0);

        s1 = _mm_subs_epu16(s1, _mm_set1_epi16(bg));
        s1 = _mm_mullo_epi16(s1, h1);
        s1 = _mm_mulhi_epu16(s1, _mm_set1_epi16(frac));
        s1 = _mm_min_epu16(s1, h1);

        s0 = _mm_packus_epi16(s0, s1);

        _mm_storeu_si128((__m128i *)&skinProb[k], s0);
    }
    for (; k < len; k++) {
        int h = hysto[(srcy[k] << 8) + srcx[k]];
        int s = src[k];

        s = s - bg;
        s = MAX(s, 0);
        s = s * h;
        s = (s * frac) >> 16;
        s = MIN(s, h);

        skinProb[k] = s;
    }
}

