//Obtain skin map based on faces
static void New_Skin_Map_C(BYTE *skinProb, BYTE *pInYUV, int w, int h, BYTE hist[][256])
{
    BYTE* srcy = pInYUV + (w*h);
    BYTE* srcx = pInYUV + 2*(w*h);

    //create estimated probability of face skin in the frame
    for (int k = 0; k < w*h; k++) {
        skinProb[k] = hist[ srcy[k] ][ srcx[k] ];
    }
}

//Obtain skin map based on faces
static void New_Skin_Map_slice_C(BYTE *skinProb, BYTE *pInYUV, int w, int h, BYTE hist[][256], uint slice_offset, int slice_nlines)
{
    BYTE* srcy = pInYUV + (w*h) + slice_offset;
    BYTE* srcx = pInYUV + 2*(w*h) + slice_offset;
    int pitch  = w;

    //create estimated probability of face skin in the frame
    for (int n=0; n<slice_nlines; n++) {
        int ind = n*pitch;
        for (int k=0; k<w; k++) {
            skinProb[ind+k] = hist[ srcy[ind+k] ][ srcx[ind+k] ];
        }
    }
}

//Obtain skin map based on faces
static void New_Skin_Map_slice_AVX2(BYTE *skinProb, BYTE *pInYUV, int w, int h, BYTE hist[][256], uint slice_offset, int slice_nlines)
{
    BYTE* srcy = pInYUV + (w*h) + slice_offset;
    BYTE* srcx = pInYUV + 2*(w*h) + slice_offset;
    int pitch  = w;

    for (int n=0; n<slice_nlines; n++) {
        int ind = n*pitch;
        for (int k = 0; k < w - 15; k += 16) {

            __m128i y = _mm_loadu_si128((__m128i *)&srcy[ind+k]);   // 16
            __m128i x = _mm_loadu_si128((__m128i *)&srcx[ind+k]);

            __m256i i0 = _mm256_cvtepu16_epi32(_mm_unpacklo_epi8(x, y));    // i = (y<<8) + x
            __m256i i1 = _mm256_cvtepu16_epi32(_mm_unpackhi_epi8(x, y));

            __m256i h = gather16_AVX2(&hist[0][0], i0, i1);                 // h = hist[i]

            h = _mm256_packus_epi16(h, h);
            h = _mm256_permute4x64_epi64(h, _MM_SHUFFLE(3,1,2,0));

            _mm_storeu_si128((__m128i *)&skinProb[ind+k], _mm256_castsi256_si128(h));
        }
    }
}

//Obtain skin map based on faces
static void New_Skin_Map_SSE4(BYTE *skinProb, BYTE *pInYUV, int w, int h, BYTE hist[][256])
{
    BYTE* srcy = pInYUV + (w*h);
    BYTE* srcx = pInYUV + 2*(w*h);

    int k;
    for (k = 0; k < (w*h) - 15; k += 16) {
        __m128i y = _mm_loadu_si128((__m128i *)&srcy[k]);   // 16
        __m128i x = _mm_loadu_si128((__m128i *)&srcx[k]);

        __m128i i0 = _mm_unpacklo_epi8(x, y);               // i = (y<<8) + x
        __m128i i1 = _mm_unpackhi_epi8(x, y);

        __m128i h = gather16_SSE4(&hist[0][0], i0, i1);     // h = hist[i]

        _mm_storeu_si128((__m128i *)&skinProb[k], h);
    }
    for (; k < w*h; k++) {
        skinProb[k] = hist[ srcy[k] ][ srcx[k] ];
    }
}

