typedef void(*t_BuildSkinMap_dyn)(BYTE* skinProb, BYTE* src, Dim* dim, uint bg, uint yTh, int hist_ind, int mode);
typedef void(*t_BuildSkinMap_dyn_slice)(BYTE* skinProb, BYTE* src, Dim* dim, uint bg, uint yTh, int hist_ind, int mode, uint slice_offset, int slice_nlines);
typedef void(*t_New_Skin_Map)(BYTE *skinProb, BYTE *pInYUV, int w, int h, BYTE hist[][256]);
typedef void(*t_New_Skin_Map_slice)(BYTE *skinProb, BYTE *pInYUV, int w, int h, BYTE hist[][256], uint slice_offset, int slice_nlines);

void BuildSkinMap_dyn_fast(BYTE* skinProb, BYTE* src, Dim* dim, uint bg, uint yTh, int hist_ind, int mode)
{
    t_BuildSkinMap_dyn f = g_FS_OPT_AVX2 ? BuildSkinMap_dyn_AVX2: (g_FS_OPT_SSE4 ? BuildSkinMap_dyn_SSE4 : BuildSkinMap_dyn_C);
    (*f)(skinProb, src, dim, bg, yTh, hist_ind, mode);
}

void BuildSkinMap_dyn_fast_slice(BYTE* skinProb, BYTE* src, Dim* dim, uint bg, uint yTh, int hist_ind, int mode, uint slice_offset, int slice_nlines)
{
    t_BuildSkinMap_dyn_slice f = g_FS_OPT_AVX2 ? BuildSkinMap_dyn_slice_AVX2: (g_FS_OPT_SSE4 ? BuildSkinMap_dyn_slice_C : BuildSkinMap_dyn_slice_C);
    (*f)(skinProb, src, dim, bg, yTh, hist_ind, mode, slice_offset, slice_nlines);
}

void New_Skin_Map_from_face(BYTE *skinProb, BYTE *pInYUV, int w, int h, BYTE hist[][256])
{
    t_New_Skin_Map f = g_FS_OPT_AVX2 ? New_Skin_Map_AVX2: (g_FS_OPT_SSE4 ? New_Skin_Map_SSE4 : New_Skin_Map_C);
    (*f)(skinProb, pInYUV, w, h, hist);
}

void New_Skin_Map_from_face_slice(BYTE *skinProb, BYTE *pInYUV, int w, int h, BYTE hist[][256], uint slice_offset, int slice_nlines)
{
    t_New_Skin_Map_slice f = g_FS_OPT_AVX2 ? New_Skin_Map_slice_AVX2: (g_FS_OPT_SSE4 ? New_Skin_Map_slice_C : New_Skin_Map_slice_C);
    (*f)(skinProb, pInYUV, w, h, hist, slice_offset, slice_nlines);
}

