//Compute dynamic luma thresholds
void Compute_dyn_luma_thresh(FrameBuffElementPtr *src, Dim* dim, uint *bg, uint *yTh) 
{
    uint yT, yHist[256];
    uint sum=0, th=0, i;
    //initialize buffers
    memset(yHist, 0, sizeof(uint)*256);

    //build luma histogram
    for (i=0; i < dim->h; i++) {
        for(uint j=0; j < dim->w; j++) {
            yHist[src->frameY[i*src->p+j]]++;
        }
    }

    //derive luma threshold
    th = dim->w*dim->h;
    for (i=0; i<10; i++ ) th-= yHist[i];
    th = th * 30 / 100;
    yT = 10;
    while (yT<50 && sum<th) {
        sum += yHist[yT];
        yT++;
    }
    *yTh = --yT;		//luma threshold
    *bg  = 7*yT / 8;	//background noise luma threshold
}

//computes skin mask histogram statistics
static void get_histogram_statistics(BYTE *frm, int w, int h, int *spread, int *solidity, int mode) 
{
    FS_UNREFERENCED_PARAMETER(mode);
    int i, j, ii, jj, x, y, a, n;
    int count, min_count;
    BYTE blk[16*16];
    int w16 = w/16;
    int h16 = h/16;

    //compute 16x16 binary representation of skin objects
    for (i=0; i<h; i+=h16) {
        for (j=0; j<w; j+=w16) {
            y = i/h16; x = j/w16; 
            if (y >= 16) continue;
            if (x >= 16) continue;

            a = n = 0;
            for (ii=0; ii<h16; ii++) {
                for (jj=0; jj<w16; jj++) {
                    if (i+ii >= h) continue;
                    if (j+jj >= w) continue;
                    a+= frm[(i+ii)*w + (j+jj)];
                    n++;
                }
            }

            blk[y*16 + x] = a/n;
            //binarize
            if (blk[y*16 + x] > 16) blk[y*16 + x] = 255;
            else blk[y*16 + x] = 0;
        }
    }

    //compute noise spread
    //32=highest spread (most unreliable map); mid values=normal spread (reliable mask); 0=empty mask
    a = 32;
    for (i=0; i<16; i++) {
        n = 0; for (j=0; j<16; j++) if (blk[i*16 + j]) n++; if (n==0) a--;
        n = 0; for (j=0; j<16; j++) if (blk[j*16 + i]) n++; if (n==0) a--;
    }
    *spread = a;

    //compute solidity
    //search for minimum number of 2D solids in the mask
    n = 3;	//3x3 square
    count = 0;
    // if (mode==0) min_count = n * 2;
    // else if (mode==1) 
    min_count = n;
    for (i=0; i<=16-n; i++) {
        for (j=0; j<=16-n; j++) {
            a = 0;
            for (ii=i; ii<i+n; ii++) {
                for (jj=j; jj<j+n; jj++) {
                    if (blk[ii*16 + jj]) a++;
                }
            }
            if (a==n*n) count++;
        }
    }
    //set solidity flag
    if (count >= min_count) *solidity = 1;
    else                    *solidity = 0;
}

//Performs skin probabilities histogram selection
int SelSkinMap(BYTE *skinProb, BYTE *src, Dim *dim, int EnableHystoDynEnh, int mode) 
{
    uint xS, yS; 
    const BYTE *hysto;
    uint yTh, yHist[256];
    uint sum = 0, th  = 0, bg;
    uint n, i, k, y, x, pos, hyst;
    uint max_val = 0, max_ind = 0;
    uint map_score   [4] = {0};
    int uoff, voff, w, h;
    int  map_spread  [4] = {0};
    int  map_solidity[4] = {0};

    // if (mode==0) { uoff = dim->uOff;  voff = dim->vOff;  w = dim->w;  h = dim->h;  }
    // else if (mode==1) 
    { uoff = dim->ubOff; voff = dim->vbOff; w = dim->wb; h = dim->hb; }

    //initialize histogram buffer
    memset(yHist, 0, sizeof(uint)*256);

    //build luma histogram
    for (i=0; i < (uint) uoff; i++) yHist[src[i]]++;

    //derive luma threshold
    th = uoff;
    for (i=0; i<10; i++ ) th-= yHist[i];
    th = th * 30 / 100;
    yTh = 10;
    while (yTh<50 && sum<th) {
        sum += yHist[yTh];
        yTh++;
    }
    yTh--;

    //reset luma histogram values to 255
    for (i=0; i<256; i++) yHist[i] = 255;

    //reset luma histogram adapted to exclude background noise
    bg = 7*yTh / 8; //background noise threshold
    if (bg > 0) {
        memset(yHist,   0, sizeof(uint) * bg);
        for (i = bg; i < yTh; i++) yHist[i] = 255 * (i - bg) / (yTh - bg);
    }

    xS = voff;
    yS = uoff;
    for (n=0; n<3; n++) {
        //initialize skin probability map to all 0 
        memset(skinProb, 0, uoff * sizeof(BYTE));

        //set skin probability map
        switch (n) {
        case 0: hysto = histoYrg;  break;
        case 1: hysto = histoYrg2; break;
        case 2: hysto = histoYrg3; break;
        }
        for (k=0, x=xS, y=yS; k < (uint) uoff; k++, x++, y++) {
            pos  = src[y] * 256 + src[x];		
            if (EnableHystoDynEnh)	hyst = hysto[pos] * yHist[src[k]] / 256;
            else					hyst = hysto[pos];

            //compute histogram score (sum of significant skin pixels)
            if (hyst > 100) {
                skinProb[k] = hyst;
                map_score[n]+= hyst;
            }
        }

        //compute the histogram statistics
        get_histogram_statistics(skinProb, w, h, &(map_spread[n]), &(map_solidity[n]), mode);

        //set the max histogram score (and corresponding index)
        if (max_val < map_score[n] && ((!n && map_spread[n]<=30) || (n && map_spread[n]<=24)) && map_solidity[n]) {
            max_val = map_score[n];
            max_ind = n;
        }
    }

    return max_ind;
}

